import React from 'react'

function NameList() {
        const names = ['sravan','krishna','samara']
        return (
                <div>
                        {
                                names.map(name => <h2>{name}</h2>)
                        }
                </div>
        )
}

export default NameList

const names = ['sravan','krishna','samara']
